function ExpenseTable() {
    const [expenses, setExpenses] = useState([]);
    const { t, i18n } = useTranslation();

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        Axios.get("http://localhost:8080/api/expenses/result")
            .then((response) => {
                setExpenses(response.data);
            })
            .catch((error) => {
                console.error("Error fetching expense data: ", error);
            });
    };

    const langs = {
        en: { title: "English" },
        lug: { title: "Luganda" },
    };

    return (
        <div>
            <ul>
                {Object.keys(langs).map((lang) => (
                    <li key={lang}>
                        <button style={{ fontWeight: i18n.resolvedLanguage === lang ? 'bold' : 'normal' }} type="submit" onClick={() => i18n.changeLanguage(lang)}>
                            {langs[lang].title}
                        </button>
                    </li>
                ))}
            </ul>

            {expenses.length === 0 ? ( // Check if expenses array is empty
                <p>Loading...</p>
            ) : (
                <table>
                    <thead>
                        <tr>
                            <th>{t('main.id')}</th>
                            <th>{t('main.firstName')}</th>
                            <th>{t('main.lastName')}</th>
                            <th>{t('main.amount')}</th>
                            <th>{t('main.category')}</th>
                        </tr>
                    </thead>
                    <tbody>
                        {expenses.map((expense) => (
                            <tr key={expense.id}>
                                <td>{expense.id}</td>
                                <td>{expense.firstName}</td>
                                <td>{expense.lastName}</td>
                                <td>{expense.amount}</td>
                                <td>{expense.category}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
}
